webpackJsonp([0xab4d64c5222c],{432:function(t,e){t.exports={data:{markdownRemark:{html:'<h3>React Basics, React Dev Tools and Mac Chrome key combos.</h3>\n<ul>\n<li>Completed the <a href="https://teamtreehouse.com/library/react-basics">React Basics</a> course at Treehouse.</li>\n<li>Install the React Dev Tools Chrome extension, then in chrome://extensions make sure to tick "Allow access to file urls" | <a href="https://github.com/facebook/react-devtools/blob/master/README.md#the-react-tab-doesnt-show-up">Link</a></li>\n<li>Switch between Chrome windows on Mac with CMD + `, </li>\n<li>CMD + Alt + Left/Right to switch tabs in a Chrome window. </li>\n<li>Ctrl + Left/Right switches to desktop and back to active pane. </li>\n<li>Alt + Tab (with Left/Right) switches between open applications. </li>\n</ul>',frontmatter:{title:"TIL 0012"}}},pathContext:{slug:"/til0012/"}}}});
